import React, { useState } from "react";

const PlaceManagement = () => {
  const [places, setPlaces] = useState([]);
  const [search, setSearch] = useState("");
  const [formData, setFormData] = useState({
    date: "",
    description: "",
    image: "",
    place: "",
  });
  const [editingIndex, setEditingIndex] = useState(null);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleAddOrUpdate = () => {
    const { date, description, image, place } = formData;
    if (!date || !description || !place) {
      alert("Date, Description, and Place are required.");
      return;
    }
    if (editingIndex !== null) {
      const updatedPlaces = [...places];
      updatedPlaces[editingIndex] = formData;
      setPlaces(updatedPlaces);
    } else {
      setPlaces([...places, formData]);
    }
    setFormData({ date: "", description: "", image: "", place: "" });
    setEditingIndex(null);
  };

  const handleEdit = (index) => {
    setFormData(places[index]);
    setEditingIndex(index);
  };

  const handleDelete = (index) => {
    const updatedPlaces = places.filter((_, i) => i !== index);
    setPlaces(updatedPlaces);
  };

  const filteredPlaces = places.filter(
    ({ date, description, place }) =>
      date.toLowerCase().includes(search.toLowerCase()) ||
      description.toLowerCase().includes(search.toLowerCase()) ||
      place.toLowerCase().includes(search.toLowerCase())
  );

  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold mb-4 text-black">Place Management</h1>

      <div className="mb-6 grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-4">
        <input
          placeholder="Date"
          type="date"
          name="date"
          value={formData.date}
          onChange={handleInputChange}
          className="border border-gray-400 rounded p-2 w-full"
        />
        <input
          placeholder="Description"
          type="text"
          name="description"
          value={formData.description}
          onChange={handleInputChange}
          className="border border-gray-400 rounded p-2 w-full"
        />
        <input
          placeholder="Image URL"
          type="text"
          name="image"
          value={formData.image}
          onChange={handleInputChange}
          className="border border-gray-400 rounded p-2 w-full"
        />
        <input
          placeholder="Place"
          type="text"
          name="place"
          value={formData.place}
          onChange={handleInputChange}
          className="border border-gray-400 rounded p-2 w-full"
        />
        <button
          onClick={handleAddOrUpdate}
          className="bg-orange-400 text-white py-2 px-4 rounded hover:bg-orange-500"
        >
          {editingIndex !== null ? "Update" : "Create"}
        </button>
      </div>

      <div className="mb-6">
        <input
          placeholder="Search by Date, Description, or Place..."
          type="text"
          value={search}
          onChange={(e) => setSearch(e.target.value)}
          className="border border-gray-400 rounded p-2 w-full"
        />
      </div>

      <table className="table-auto w-full border-collapse border border-gray-400">
        <thead>
          <tr>
            <th className="px-4 py-2 border-b bg-gray-100 text-left text-black">Date</th>
            <th className="px-4 py-2 border-b bg-gray-100 text-left text-black">Description</th>
            <th className="px-4 py-2 border-b bg-gray-100 text-left text-black">Place</th>
            <th className="px-4 py-2 border-b bg-gray-100 text-left text-black">Image</th>
            <th className="px-4 py-2 border-b bg-gray-100 text-left text-black">Actions</th>
          </tr>
        </thead>
        <tbody>
          {filteredPlaces.map((place, index) => (
            <tr key={index} className="border-b hover:bg-gray-50">
              <td className="px-4 py-2 text-black">{place.date}</td>
              <td className="px-4 py-2 text-black">{place.description}</td>
              <td className="px-4 py-2 text-black">{place.place}</td>
              <td className="px-4 py-2">
                {place.image && (
                  <img
                    src={place.image}
                    alt={place.description}
                    className="w-16 h-16 object-cover rounded"
                  />
                )}
              </td>
              <td className="px-4 py-2">
                <button
                  onClick={() => handleEdit(index)}
                  className="bg-orange-400 text-white py-1 px-3 rounded hover:bg-orange-500"
                >
                  Edit
                </button>
                <button
                  onClick={() => handleDelete(index)}
                  className="bg-red-500 text-white py-1 px-3 rounded hover:bg-red-600 ml-2"
                >
                  Delete
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default PlaceManagement;
